import React from 'react';


class Request extends React.Component{

    constructor(props) {
        super(props);
        this.state = {
          error: null,
          isLoaded: false,
          items: []
        };
      }

      componentDidMount() {
          var newSec = parseInt(this.props.seconds)
          console.log({newSec});

      }
      componentDidUpdate(){
        console.log("unmount");
        clearInterval(this.state.intervalId)
      }


      render() {
        const { error, isLoaded, result } = this.state;
        if (error) {
          return <div>Error: {error.message}</div>;
        } else if (!isLoaded) {
          return <div>Loading...</div>;
        } else {
          return (
            <ul>
              {this.state.result.map((item, index) => (
                <li key={index}>
                    {this.state.result[index].from}
                    {this.state.result[index].to}
                   <div> {this.state.result[index].rate}</div>
                    {this.state.result[index].orderExpiresIn}
                    {this.state.result[index].status}


                </li>
              ))}
            </ul>
          );
        }
      }
    }


export default Request;
